from collections import Counter

class Solution(object):
    def hasGroupsSizeX(self, deck):
        """
        :type deck: List[int]
        :rtype: bool
        """
        def gcd(a, b):
            while(b): 
                a, b = b, a % b
            
            return a

        counts = Counter(deck).values()

        return reduce(gcd, counts) > 1

    def hasGroupsSizeX2(self, deck):
        """
        :type deck: List[int]
        :rtype: bool
        """
        dic = {}

        def gcd(a, b):
            while(b): 
                a, b = b, a % b
            
            return a

        for num in deck:
            if num in dic:
                dic[num] += 1
            else:
                dic[num] = 1

        if len(dic.keys()) < 2:
            return dic.values()[0] >= 2
        else:
            sorted_val = sorted(dic.values())
            idx = 0
            bound = len(sorted_val) - 2
            
            while idx < bound and sorted_val[idx] == sorted_val[idx + 1]:
                idx += 1

            temp_gcd = gcd(sorted_val[idx], sorted_val[idx + 1])

            if temp_gcd == 1:
                return False

            for num in sorted_val:
                if num % temp_gcd != 0:
                    return False

            return True


